{
  "definitions": {},
  "$schema": "http://json-schema.org/draft-07/schema#",
  "$id": "http://example.com/root.json",
  "type": "object",
  "title": "The Root Schema",
  "required": [
    "Id",
    "Name",
    "Description",
    "GlobalTracking",
    "GlobalArchiving",
    "Type",
    "TaskParameters",
    "Properties"
  ],
  "properties": {
    "Id": {
      "$id": "#/properties/Id",
      "type": "integer",
      "title": "The Id Schema",
      "default": 0,
      "examples": [
        1
      ]
    },
    "Name": {
      "$id": "#/properties/Name",
      "type": "string",
      "title": "The Name Schema",
      "default": "",
      "examples": [
        "Testing Task"
      ],
      "pattern": "^(.*)$"
    },
    "Description": {
      "$id": "#/properties/Description",
      "type": "string",
      "title": "The Description Schema",
      "default": "",
      "examples": [
        "Test"
      ],
      "pattern": "^(.*)$"
    },
    "GlobalTracking": {
      "$id": "#/properties/GlobalTracking",
      "type": "boolean",
      "title": "The Globaltracking Schema",
      "default": false,
      "examples": [
        true
      ]
    },
    "GlobalArchiving": {
      "$id": "#/properties/GlobalArchiving",
      "type": "boolean",
      "title": "The Globalarchiving Schema",
      "default": false,
      "examples": [
        true
      ]
    },
    "Type": {
      "$id": "#/properties/Type",
      "type": "string",
      "title": "The Type Schema",
      "default": "",
      "examples": [
        "External"
      ],
      "pattern": "^(.*)$"
    },
    "TaskParameters": {
      "$id": "#/properties/TaskParameters",
      "type": "array",
      "title": "The Taskparameters Schema",
      "items": {
        "$id": "#/properties/TaskParameters/items",
        "type": "object",
        "title": "The Items Schema",
        "required": [
          "Id",
          "Key",
          "Description",
          "Required",
          "Type"
        ],
        "properties": {
          "Id": {
            "$id": "#/properties/TaskParameters/items/properties/Id",
            "type": "integer",
            "title": "The Id Schema",
            "default": 0,
            "examples": [
              1
            ]
          },
          "Key": {
            "$id": "#/properties/TaskParameters/items/properties/Key",
            "type": "string",
            "title": "The Key Schema",
            "default": "",
            "examples": [
              "taskname"
            ],
            "pattern": "^(.*)$"
          },
          "Description": {
            "$id": "#/properties/TaskParameters/items/properties/Description",
            "type": "string",
            "title": "The Description Schema",
            "default": "",
            "examples": [
              "Test"
            ],
            "pattern": "^(.*)$"
          },
          "Required": {
            "$id": "#/properties/TaskParameters/items/properties/Required",
            "type": "boolean",
            "title": "The Required Schema",
            "default": false,
            "examples": [
              true
            ]
          },
          "Type": {
            "$id": "#/properties/TaskParameters/items/properties/Type",
            "type": "string",
            "title": "The Type Schema",
            "default": "",
            "examples": [
              "Text"
            ],
            "pattern": "^(.*)$"
          }
        }
      }
    },
    "Properties": {
      "$id": "#/properties/Properties",
      "type": "array",
      "title": "The Properties Schema",
      "items": {
        "$id": "#/properties/Properties/items",
        "type": "object",
        "title": "The Items Schema",
        "required": [
          "Id",
          "Name",
          "Value"
        ],
        "properties": {
          "Id": {
            "$id": "#/properties/Properties/items/properties/Id",
            "type": "integer",
            "title": "The Id Schema",
            "default": 0,
            "examples": [
              1
            ]
          },
          "Name": {
            "$id": "#/properties/Properties/items/properties/Name",
            "type": "string",
            "title": "The Name Schema",
            "default": "",
            "examples": [
              "IsHttp"
            ],
            "pattern": "^(.*)$"
          },
          "Value": {
            "$id": "#/properties/Properties/items/properties/Value",
            "type": "string",
            "title": "The Value Schema",
            "default": "",
            "examples": [
              "true"
            ],
            "pattern": "^(.*)$"
          }
        }
      }
    }
  }
}
